    protected override void OnInitialized()
    {
        navlink = $"Reactions/{trigger.TriggerID}";

            ThisTriggerReactions = new List<Reaction>();
            ThisTriggerReactions =  trigger.TriggersReactions.Select(tr => tr.Reaction).ToList();
        
       
